function setSearch(key){$("#map-search").empty();$('#map-search').append("<option></option>");for(var n=0;n<ids[key].length;n++){$('#map-search').append("<option>"+ids[key][n]+"</option>");}}
function search_top(__group__){var elems=$('.slicetext');var clicker=null;var name='';for(var n=0;n<elems.length;n++){name=$(elems[n]).text();if(name==__group__){clicker=$(elems[n]).parent().get(0);break;}}
if(clicker==null){return;}
if(document.createEvent){var event=document.createEvent("MouseEvents");event.initMouseEvent("click",true,true,window,0,0,0,0,0,false,false,false,false,0,null);!clicker.dispatchEvent(event);}else if(link.fireEvent){!clicker.fireEvent("onclick");}}
function search_asset(__asset_name){var elems=$('.slicetext');var clicker=null;for(var n=0;n<elems.length;n++){var name=$(elems[n]).text();if((name.includes(__asset_name))&&(name.slice(0,__asset_name.length)==__asset_name)){var leftover=name.slice(__asset_name.length,name.length)
var tail_cnt=0;var digits=leftover.match(/\d/g);if(digits!=null){tail_cnt+=digits.length;}
if(leftover.includes("-")){tail_cnt+=1}
if(leftover.includes(".")){tail_cnt+=1}
if(leftover.includes("%")){tail_cnt+=1}
if((leftover.length-tail_cnt)==0){clicker=$(elems[n]).parent().get(0);break;}}}
if(clicker==null){return}
if(document.createEvent){var event=document.createEvent("MouseEvents");event.initMouseEvent("click",true,true,window,0,0,0,0,0,false,false,false,false,0,null);!clicker.dispatchEvent(event);}else if(link.fireEvent){!clicker.fireEvent("onclick");}}
function reframe(code){names.push(frm[code]["종목명"])
scale.push(frm[code]["크기"])
caps.push(frm[code]["시가총액"])
price.push(frm[code]["종가"])
perf.push(frm[code][option_type])
color.push(frm[code]['C'+option_type])}
function barplot(key){bar_data=[]
bar[key].forEach(function(code){bar_data.push({'종목명':frm[code]['종목명'],'옵션':frm[code][option_type],'색상':frm[code]['C'+option_type]})})
bar_data=bar_data.sort(function(a,b){return a['옵션']-b['옵션'];});names=[];perf=[];color=[]
bar_data.forEach(function(elem){if(map_type=='etf'){if(elem['종목명']=='레버리지'){elem['종목명']='레버리지(파생)'}else if(elem['종목명']==' 레버리지 '){elem['종목명']='레버리지(지수)'}else if(elem['종목명']=='인버스'){elem['종목명']='인버스(파생)'}else if(elem['종목명']==' 인버스 '){elem['종목명']='인버스(지수)'}}
names.push(elem['종목명'])
perf.push(elem['옵션'])
color.push(elem['색상'])})
if(map_type=='ind'){bar_layout.margin.l=c_media.matches?110:125}else if(map_type=='sec'){bar_layout.margin.l=c_media.matches?80:88}else if(map_type=='etf'){bar_layout.margin.l=c_media.matches?85:93}else if(map_type=='thm'){bar_layout.margin.l=c_media.matches?105:112}
var x_rng=Math.abs(perf[0]);perf.forEach(function(e){x_rng=e>x_rng?e:x_rng})
if(c_media.matches){bar_layout.xaxis.range=[0,1.3*x_rng]}else{bar_layout.xaxis.range=[0,1.15*x_rng]}
if(option_type=='PER'||option_type=='PBR'){var text=option_type
var unit=''}else{var text='수익률'
var unit='%'}
var bar_draw={type:'bar',y:names,x:arrAbs(perf),orientation:'h',marker:{color:color},text:perf,texttemplate:"%{text}"+unit,textposition:"outside",hovertemplate:"섹터명: %{y}<br>"+text+": %{x}"+unit+"<extra></extra>",opacity:0.9};Plotly.newPlot('myMap',[bar_draw],bar_layout,bar_option);}
function treemap(key){names=[];scale=[];caps=[];price=[];perf=[];color=[]
labels[key].forEach(function(code){names.push(frm[code]["종목명"])
scale.push(frm[code]["크기"])
caps.push(frm[code]["시가총액"])
price.push(frm[code]["종가"])
perf.push(frm[code][option_type])
color.push(frm[code]['C'+option_type])})
if(option_type=='PER'||option_type=='PBR'){var text=option_type
var unit=''}else{var text='수익률'
var unit='%'}
var map_draw={type:'treemap',branchvalues:'total',labels:names,parents:covers[key],ids:ids[key],values:scale,meta:caps,customdata:price,text:perf,textposition:'middle center',textfont:{family:'NanumGothic, Nanum Gothic, monospace',color:'#ffffff'},texttemplate:'%{label}<br>%{text}'+unit+'<br>',hovertemplate:'%{label}<br>시총: %{meta}<br>종가: %{customdata}원<br>'+text+': %{text}'+unit+'<extra></extra>',hoverlabel:{font:{family:'NanumGothic, Nanum Gothic, monospace',color:'#ffffff'}},opacity:0.9,marker:{colors:color,visible:true},pathbar:{"visible":true}}
Plotly.newPlot('myMap',[map_draw],map_layout,map_option);}
